Tor Browser Bundle 7.0.10 {Ltest}


Surfing anonymously provides a powerful shield against network surveillance and traffic analysis. Protecting your online privacy can only be achieved by additional software tools that can hide your location and can prevent your online information and browsing habits from being revealed to anyone. If youre ever in need of such a tool, Tor Browser Bundle is one suggestion you can add to the list.


Vidalia&#x2019;s interface encases a collection of shortcuts that allow you to stop the service, to start setting up the relays, to trigger a global view of the network and most important of all, it sports a button for using a new identity any time you wish. If you&#x2019;re interested in bandwidth usage, Vidalia features a separate utility just for showing a bandwidth graph that measures the receive/send rate of the packets.

The portable Firefox version included in the download package is customized with a few extensions that make the anonymous surfing experience easier. These include: Torbutton - allows you to create a new identity each time you start a browsing session, NoScript - blocks scripts from untrusted domains and HTTPS Everywhere - enables you to encrypt the communication with a lot of popular sites.

With all the components it encases, Tor Browser Bundle is one of the most trustworthy anonymous surfing tools out there. It can be configured from command prompt, run from its dedicated GUI controller - Vidalia and comes with a pre-configured web browser. Whichever of these methods you choose the result is a safe and controlled Internet browsing experience.

